import Page from "../common/Page"
import classes from "./PostDetailPage.module.css"
import { useParams } from 'react-router-dom';
import { useState, useEffect } from "react"
// import {getRoomListApi} from '../../../api/RoomApi'


const landlord = {
    list: "50",
    cover: "https://funny-daffodil-350bc9.netlify.app/images/customer/team-1.jpg",
    address: "Liverpool, Canada",
    name: "Sargam S. Singh",
    icon: [<i class='fa-brands fa-facebook-f'></i>, <i class='fa-brands fa-linkedin'></i>, <i class='fa-brands fa-twitter'></i>, <i class='fa-brands fa-instagram'></i>],
}

const data =  {
    id: 1,
    cover: "https://funny-daffodil-350bc9.netlify.app/images/list/p-1.png",
    name: "Red Carpet Real Estate",
    location: "210 Zirak Road, Canada",
    category: "For Rent",
    price: "$3,700",
    type: "Apartment",
}

const typeData = [
    {
        text: "Family House",
        value: "Family House"
    },
    {
        text: "House & Villa",
        value: "House & Villa"
    },
    {
        text: "Apartment",
        value: "Apartment"
    },
    {
        text: "Office & Studio",
        value: "Office & Studio"
    },
    {
        text: "Villa & Condo",
        value: "Villa & Condo"
    },
    
]

const PostDetailPage = () => {
    const params = useParams()

    const id = params.id
    
    const [post, setPost] = useState({})
    
    // useEffect(() => {
    //     getRoomListApi({
    //         "id": id
    //     })
    //     .then((data) => {
    //       const tempData = []
    //       data.data.forEach(item => {
    //         tempData.push({
    //               cover: `https://funny-daffodil-350bc9.netlify.app/images/list/p-1.png`,
    //               totalPrice: item.rent_price + item.water_price + item.electricity_price + item.service_price,
    //               location: `${item.city} - ${item.district} - ${item.ward}`,
    //               ...item
    //           })
    //       })
    //       setPost(tempData[0])
    //       console.log(tempData[0])
    //     })
    //     .catch((err) => {
    //         alert(err.message);
    //     });
    // }, [id])
    
    return (
        <Page>
            <section class={classes.post}>
                <div class={`${classes.grid} ${classes.wide}`}>
                    <div class={`${classes.row} ${classes.nogutters}`}>
                        <div class={`${classes.col} ${classes.c8} ${classes.postdetail}`}>
                            <div class={classes.header}>
                                <div class={classes.headerdetail}>
                                    <h1>{post.room_name}</h1>
                                    <p><i class="fa fa-location-dot"></i>{post.location}</p>
                                </div>
                                <div class={classes.headercategory}>
                                    <button class={classes.btn3}>{typeData[post.room_type].text}</button>
                                </div>
                            </div>
                            <div class={classes.main}>
                                <img src={data.cover} alt=""/>
                                <p class={classes.description}>{post.detail}</p>
                                <p>
                                    <i class="fa fa-money-check"></i> Rent price: {post.rent_price}đ / month
                                </p>
                                <p>
                                    <i class="fa fa-money-check"></i> Water price: {post.water_price}đ / month
                                </p>
                                <p>
                                    <i class="fa fa-money-check"></i> Electricity price: {post.electricity_price}đ / month
                                </p>
                                <p>
                                    <i class="fa fa-money-check"></i> Services price: {post.service_price}đ / month
                                </p>
                                <div class={classes.mainButton}>
                                    <button>{post.totalPrice}đ / month</button>
                                    <button>Rent</button>
                                </div>
                            </div>
                        </div>
                        <div class={`${classes.col} ${classes.c4} ${classes.landlord}`}>
                            <div class={classes.landlordDetails}>
                                <button class={classes.btn3}>80 Listings</button>
                                <div class={classes.details}>
                                    <div class={classes.img}>
                                        <img src={landlord.cover} alt='' />
                                        <i class='fa-solid fa-circle-check'></i>
                                    </div>
                                    <i class='fa fa-location-dot'></i>
                                    <label>{landlord.address}</label>
                                    <h4>{landlord.name}</h4>
                                    
                                    <ul>
                                        {landlord.icon.map((icon, index) => (
                                        <li key={index}>{icon}</li>
                                        ))}
                                    </ul>
            
                                    <div class={`${classes.button} ${classes.flex}`}>
                                        <button>
                                            <i class='fa fa-envelope'></i>
                                            Message
                                        </button>
                                        <button class={classes.btn4}>
                                            <i class='fa fa-phone-alt'></i>
                                        </button>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </Page>
    )
}

export default PostDetailPage
